    this.ready = function () {
        initCss();
        initIconSymbol();
    }
    /**
     * 顶部插入样式
     */
    this.initCss = function () {
        if (!window.__iconfont__initcss) {
            window.__iconfont__initcss = true;
            $('title').after('<style type="text/css">.icon {width: 1em; height: 1em;vertical-align: -0.15em;fill: currentColor;overflow: hidden;}</style>')
        }
    };
    /**
     * 检查页面svg use 插入 对应symbol
     */
    this.initIconSymbol = function () {
        //添加symbols区域
        if (!window.__iconfont__initsymbols) {
            window.__iconfont__initsymbols = true;
            $('body').before('<symbols aria-hidden="true" style="position:absolute;width:0px;height:0px;overflow:hidden;"></symbols>');
        }
        //检查页面svg use 筛选出未加载的symbol
        var ids = getSvgIocnIds();
        ids = $.unique(ids);        //当加载的symbol的数量大于0 时加载对应symbol
        if (ids.length > 0) {
            getSymbols(ids);
        }
    }
    //获取页面svg icon 的id
    this.getSvgIocnIds = function () {
        var ids = [];
        var svgUses = $('svg use');
        $.each(svgUses, function () {
            var id = $.trim($(this).attr('xlink:href'));
            id = id.replace('#', '').replace('iconfont ');
            if (!id) return;
            ids.push(id);
        });
        return ids;
    }
    /**
     * 检查页面svg use 筛选出未加载的id
     */
    this.checkSymbols = function (ids) {
        if (!ids) return [];
        if (!Array.isArray(ids)) { ids = [ids]; }
        var rids = [];
        $.each(ids, function (key, val) {
            var id = val;
            var symbol = $('symbols symbol[id="' + id + '"]').get(0);
            if (!symbol) rids.push(id);
        });
        return rids;
    }
    /**
     * 查询Symbol数据并插入
     */
    this.getSymbols = function (ids) {
        ids = checkSymbols(ids);
        if (ids.length == 0) return;
        $.ajax({
            type: 'POST',
            url: '/Serv/API/Common/IconSymbols.ashx',
            data: {ids:ids.join(',')},
            success: function (resp) {
                if (resp.status) {
                    $('symbols').append(resp.result);
                    reloadSymbol(ids);
                }
            }
        });
    }
    this.reloadSymbol = function (ids) {
        var svgs = $('svg');
        $.each(svgs, function () {
            var use = $(this).find('use');
            if(!use) return;
            var id = $.trim($(use).attr('xlink:href'));
            id = id.replace('#', '').replace('iconfont ');
            if (ids.indexOf(id) >= 0) {
                var nsvg = $(this).clone();
                $(this).parent().append('<svg class="icon" aria-hidden="true"><use xlink:href="#icon-zhongjiang"></use></svg>');
                $(this).parent().append('<svg class="icon" aria-hidden="true"><use xlink:href="#icon-zhongjiang"></use></svg>');
                $(this).parent().append('<svg class="icon" aria-hidden="true"><use xlink:href="#icon-zhongjiang"></use></svg>');
                $(this).parent().append('<svg class="icon" aria-hidden="true"><use xlink:href="#icon-zhongjiang"></use></svg>');
                //$(this).html('');
                //$(this).append(nuse);
                //use
                //$(this).reload();
            }
        });
    }
    ready();
